import smile_emoji from "./img/smile.png";

const SignupDone = () => {
    return (
        <div className="SignupDone">
            <form className="push_form_container">
                <div className="push_head_bell_image">
                    <div className="push_head">
                        <h2>회원가입이 완료됐어요!</h2>
                    </div>
                    <div className="bell_image">
                        <img src={smile_emoji} alt="Smile Emoji" />
                    </div>
                </div>
                <div>
                    <h3>
                        자 이제 폰똑으로 공부하러 가볼까요?
                        <br />
                        폰똑과 함께라면 스마트폰 완전 정복!
                    </h3>
                </div>
                <div className="button-group">
                    <button
                        type="button"
                        className={`button ${
                            selectedButton === 1 ? "selected" : ""
                        }`}
                        onClick={() => handleButtonClick(1)}
                    >
                        안 할래요
                    </button>
                    <button
                        type="button"
                        className={`button ${
                            selectedButton === 2 ? "selected" : ""
                        }`}
                        onClick={() => handleButtonClick(2)}
                    >
                        좋아요
                    </button>
                </div>
                <button className="push_submit_btn">확인</button>
            </form>
        </div>
    );
};

export default SignupDone;
